Nature's Martini⁣
..........⁣
1 oz Spruce Balsam and Cedar infused Northern Keep Vodka @northernkeepvodka⁣
0.5 oz Northern Keep Vodka⁣
0.5 oz Dry Vermouth⁣
Barspoon Green Chartreuse⁣
Pinch of salt⁣
⁣
Stir all ingredients in a mixing glass. Garnish: Spruce Tip.⁣
